Я Анна. Работаю по четырём направлениям:
системные расстановки;
индивидуальный и семейный психолог;
психоаналитик;
сексолог, психосоматолог.

Комплексный подход - это осознанный профессиональный выбор. Ведь за каждой проблемой стоит ДУША и ЛИЧНОСТЬ человека.

Не обязательно быть правильной, стандартной, идеальной. Но обязательно быть СЧАСТЛИВОЙ, наполняться энергией для реализации в профессии, семье и отношениях.
